import React, {Component} from 'react';
import Navigation from '../components/Navigation'



class Header extends Component {
  constructor(props){
    super(props)
    this.state = {}

  }

  render (){
     return (
       <div className='header'>
        <Navigation/>
       </div>
     )
  }
}

export default Header;
